import './loginform.min.css';

export const LoginForm = () => {
  return (
    <div className = "loginform">
      <h1>Login</h1>
        <form method = "post">
          <div className = "text_field">
            <input type="text" required>
              <label>Username</label>
            </input>
          </div>
          <div className = "text_field">
            <input type="password" required>
              <label>Password</label>
            </input>
          </div>
        </form>
    </div>
  );
}
